import Layout from '../components/layout'
import Head from 'next/head'
function HomePage() {
  return (
    <Layout>
      <Head>
        <title>Ana Sayfa</title>
      </Head>
      <h1>Welcome to Next.js!</h1>
    </Layout>
  )
}

export default HomePage
